import Link from 'next/link'
import { useSelector } from 'react-redux';
import Theme from '../styles/theme'

function MyProfile() {
    const {profile} = useSelector(state => state.post)

    return (
        <div className='profile'>
            <h1>{profile && profile.name}</h1>
            <ul>
                <div className='break'>
                    <label>Email: </label>
                    <li>{profile && profile.email}</li>
                </div>
                <div className='break'>
                    <label>Permission Level: </label>
                    <li>{profile && profile.permissionLevel}</li>
                </div>
            </ul>
            <div className='break'>
                <Link href='/forgotpassword'><h2>Forgot Password</h2></Link>
            </div>
            <style jsx>{`
                .profile {
                    float: left;
                    width: 90%;
                    margin: 10px 5%;
                    min-height: 200px;
                    background: white;
                    margin-top: 120px;
                    box-shadow: ${Theme.sh.mat};
                }
                h1 {
                    float: left;
                    margin: 10px;
                    font: 32px 'Montserrat';
                }
                .break {
                    float: left;
                    width: 100%;
                    margin: 5px 0;
                }
                ul {
                    padding: 10px 5px;
                    float: left;
                }
                ul li {
                    list-style: none;
                    float: left;
                    margin: 10px 5px;
                    font: 16px 'Roboto';
                }
                ul label {
                    list-style: none;
                    float: left;
                    margin: 10px 5px;
                    font: 14px 'Roboto';
                }
                h2 {
                    float: left;
                    font: 16px 'Roboto';
                    background: blue;
                    color: white;
                    padding: 10px 5px;
                    margin: 10px 5px;
                }
            `}</style>
        </div>
    )
}

export default MyProfile
